    LT: 0,
    GT: 1,
    EQ: 2,
    NEQ: 3,
    LEQ: 4,
    GEQ: 5
};

export const GATEWAYTPYES = [
    { key: 0, text: "Databased Exclusive", value: 0 },
    { key: 1, text: "Databased Inclusive", value: 1 }
];

export const GATEWAYTYPES = { DBEXCL: 0, DBINCL: 1 };

export const DECISIONTYPES = { STRDESC: 0, INTDESC: 1 };
